import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [images, setImages] = React.useState([]);

  React.useEffect(() => {
    setImages(['2'])
  }, [])

  return (
    <div className='mt-5'>{images.length}</div>
  );
}

export default App;
